import React from 'react';


class ChildA extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            childData : ""
        }
    }   

    handleChildData = () => {
        this.setState({
            childData: "This is child data."
        })
    }
    componentDidMount(){
        this.handleChildData(this.state.childData)
    }
    render(){
        return (
            <div>
                <p>This is Child component.</p>
                <p>{this.props.parentData}</p>
            </div>
        )
    };
};

export default ChildA
